import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Navbar from "../component/navbar";
import Footer from "../component/footer";
import { Link, useNavigate } from "react-router-dom";

const VideoItem = ({ video }) => (
  <div
    key={video.id}
    className="grow shrink basis-0 h-48 p-4 rounded-md border border-black border-opacity-10 justify-center items-start gap-4 flex"
  >
    <div className="w-[100px] h-[100px] justify-start items-start flex">
      <div className="w-[100px] h-[100px] relative bg-zinc-300 bg-opacity-50"></div>
    </div>
    <div className="grow shrink basis-0 flex-col justify-start items-start gap-2 inline-flex">
      <div className="self-stretch text-black text-xl font-medium font-['Roboto'] leading-7">
        {video.nomvideo}
      </div>
      <div className="self-stretch text-black text-opacity-50 text-sm font-normal font-['Roboto'] leading-tight">
        Step by step guide
      </div>
      <div className="self-stretch text-black text-base font-normal font-['Roboto'] leading-normal">
        {video.description}
      </div>
      <div className="self-stretch py-1 justify-start items-center gap-1.5 inline-flex">
        {/* ... (reste du code pour les boutons et informations) */}
      </div>
    </div>
    <br />
  </div>
);

function VideosPage() {
  const userString = sessionStorage.getItem("user");
  const user = userString ? JSON.parse(userString) : null;
  const { NomTutorial, Nomvideo } = useParams();
  const [Tutorial, setTutorial] = useState([]);
  const [video, setVideo] = useState([]);
  const [datavideo, setdataVideo] = useState([]);
  const [videos, setVideos] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    if (!user) {
      navigate("/");
    }
  }, [user, navigate]);

  useEffect(() => {
    const Enrehistory = async () => {
      const vue = {
        id_user: user.id,
        id_video: video.id,
      };

      try {
        const response = await fetch("http://localhost:3001/historique", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({ vue }),
        });

        const data = await response.json();
      } catch (error) {
        console.error("Erreur lors de la requête :", error);
      }
    };

    if (video.id) {
      Enrehistory();
    }
  }, [user, video]);

  useEffect(() => {
    const fetchTutorial = async () => {
      try {
        const response = await fetch(
          `http://localhost:3001/Tutorial/${NomTutorial}`
        );
        const data = await response.json();
        setTutorial(data.tutorial);
        setVideos(data.tutorial.videos);
      } catch (error) {
        console.error("Erreur lors de la requête :", error);
      }
    };

    const fetchVideo = async () => {
      try {
        const response = await fetch(
          `http://localhost:3001/Tutorial/${NomTutorial}/${Nomvideo}`
        );
        const data = await response.json();
        setVideo(data.video[0]);
        setdataVideo(data.video[0].video.data);
      } catch (error) {
        console.error("Erreur lors de la requête :", error);
      }
    };

    fetchTutorial();
    fetchVideo();
  }, [NomTutorial, Nomvideo]);

  return (
    <div>
      <Navbar />
      <div className="video-page">
        <div className="video-container">
          <video width="800" controls>
            <source
              src={`data:video/mp4;base64,${btoa(String.fromCharCode.apply(null, new Uint8Array(datavideo)))}`}
              type="video/mp4"
            />
          </video>
        </div>
        <div className="video-list">
          {videos.map((itemV) => (
            <Link
              key={itemV.id}
              to={`/categories/Tutorial/${Tutorial.NomTutorial}/${itemV.nomvideo}`}
            >
              <VideoItem video={itemV} />
            </Link>
          ))}
        </div>
        <div className="video-details">
          <h2>{video.nomvideo}</h2>
          <p>{video.description}</p>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default VideosPage;
